import React from 'react';

const Todo = props => {

    const {id,completed} = props;
    console.log('todo task, id, completed', props.item.task, props.item.id, props.item.completed)

    return(
        <div className = 'todo-item'
            id = {id}
            completed = {completed}
            onClick = {() => props.toggleItem({id})}>
            <p> {props.item.task}</p>
        </div>
    )
}

 export default Todo;
